def intersection(interval1, interval2):
    start1, end1 = interval1
    start2, end2 = interval2

    if start1 > end2 or start2 > end1:
        return "NO"

    intersection_start = max(start1, start2)
    intersection_end = min(end1, end2)

    length = intersection_end - intersection_start + 1

    if length <= 1:
        return "NO"

    if length == 2:
        return "YES"

    if length == 4:
        return "YES"

    for i in range(2, int(math.sqrt(length)) + 1):
        if length % i == 0:
            return "NO"

    return "YES"

def minPath(grid, k):
    def dfs(x, y, path_len, path):
        if path_len == k:
            return path

        min_path = []
        for dx, dy in [(1, 0), (-1, 0), (0, 1), (0, -1)]:
            nx, ny = x + dx, y + dy
            if 0 <= nx < len(grid) and 0 <= ny < len(grid[0]) and not visited[nx][ny]:
                visited[nx][ny] = True
                new_path = dfs(nx, ny, path_len + 1, path + [grid[nx][ny]])
                if not min_path or new_path < min_path:
                    min_path = new_path
                visited[nx][ny] = False

        return min_path

    visited = [[False for _ in range(len(grid[0]))] for _ in range(len(grid))]
    result = []
    for i in range(len(grid)):
        for j in range(len(grid[0])):
            visited[i][j] = True
            result = dfs(i, j, 1, [grid[i][j]])
            visited[i][j] = False

    return result

