    hist = {}
    for letter in lst:
        if letter in hist:
            hist[letter] += 1
        else:
            hist[letter] = 1
    if not hist:
        return {}
    max_count = max(hist.values())
    return {k: v for k, v in hist.items() if v == max_count}

