def Strongest_Extension(class_name, extensions):
    def calc_strength(ext):
        return sum(1 for c in ext if c.isupper()) - sum(1 for c in ext if c.islower())

    max_strength = float('-inf')
    strongest_ext = ""

    for ext in extensions:
