def intersection(interval1, interval2):
    start1, end1 = interval1
    start2, end2 = interval2

    if start1 > end2 or start2 > end1:
        return "NO"

    intersection_start = max(start1, start2)
    intersection_end = min(end1, end2)

    length = intersection_end - intersection_start + 1

    if is_prime(length):
        return "YES"
    else:
        return "NO"

from itertools import permutations

def minPath(grid, k):

    def get_path_value(path, grid):
        return [grid[i][j] for i, j in path]

    N = len(grid)

    possible_paths = permutations([(i, j) for i in range(N) for j in range(N)], k)

    min_path = None

    for path in possible_paths:
        path_value = get_path_value(path, grid)
        if min_path is None or path_value < min_path:
            min_path = path_value

    return min_path

def do_algebra(operators, operands):
    expression = str(operands[0])
    for i in range(len(operators)):
        expression += operators[i] + str(operands[i + 1])
    return eval(expression)
